import {STORE_CASHIERS} from '../Constants'

const initialState = {
    response:{
        status:false,
        message:''
    }
}

export default function(state=initialState,action){
    switch(action.type){
        case STORE_CASHIERS:
            return {
                ...state,
                response:action.payload
            }

            default:
                return state
    }
}
